import React from 'react'
import styled from 'styled-components'
import Map from 'react-leaflet'

export const Containermapa = styled.div`
    height: 200px ;
    z-index: 1;
`;

export const Mapa = styled(Map)`
    height: 200px ;
    z-index: 1;
`;
